import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import { Button, Menu, MenuItem } from "@mui/material";
import Adminhome from "./Adminhome";
import Adminresister from "./Adminresister";
import Adminlogin from "./Adminlogin";
import Admingmail from "./Admingmail";
import Adminpassword from "./Adminpassword";
import Admindelete from "./Admindelete";
import Customerresister from "./Customerresister";
import Customerlogin from "./Customerlogin";
import Customergmail from "./Customergmail";
import Customerpassword from "./Customerpassword";
import Productpage from "./Productpage";
import backgroundImage from "./Backgroundimmage"

// Home page component with background image
function HomePage() {
  return (
    <div
      style={{
        backgroundImage: `url(${Backgroundimmage})`,
        backgroundSize: "cover",
        backgroundPosition: "center",
        minHeight: "100vh",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        color: "white",
        fontSize: "24px",
      }}
    >
      Welcome to Admin and Customer Portal
    </div>
  );
}

export default function App() {
  const [adminAnchorEl, setAdminAnchorEl] = React.useState(null);
  const [customerAnchorEl, setCustomerAnchorEl] = React.useState(null);

  const handleAdminMenuClick = (event) => {
    setAdminAnchorEl(event.currentTarget);
  };

  const handleCustomerMenuClick = (event) => {
    setCustomerAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAdminAnchorEl(null);
    setCustomerAnchorEl(null);
  };

  return (
    <Router>
      <div>
        <nav style={{ marginBottom: "20px" }}>
          {/* Admin Button */}
          <Button
            variant="contained"
            color="primary"
            onClick={handleAdminMenuClick}
            style={{ marginRight: "10px" }}
          >
            Admin
          </Button>
          <Menu
            anchorEl={adminAnchorEl}
            open={Boolean(adminAnchorEl)}
            onClose={handleMenuClose}
          >
            <MenuItem component={Link} to="/Adminresister" onClick={handleMenuClose}>
              Go to Admin Register
            </MenuItem>
            <MenuItem component={Link} to="/Adminlogin" onClick={handleMenuClose}>
              Go to Admin Login
            </MenuItem>
          </Menu>

          {/* Customer Button */}
          <Button
            variant="contained"
            color="secondary"
            onClick={handleCustomerMenuClick}
          >
            Customer
          </Button>
          <Menu
            anchorEl={customerAnchorEl}
            open={Boolean(customerAnchorEl)}
            onClose={handleMenuClose}
          >
            <MenuItem component={Link} to="/Customerresister" onClick={handleMenuClose}>
              Go to Customer Register
            </MenuItem>
            <MenuItem component={Link} to="/Customerlogin" onClick={handleMenuClose}>
              Go to Customer Login
            </MenuItem>
          </Menu>
        </nav>

        {/* Routes */}
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/Adminhome" element={<Adminhome />} />
          <Route path="/Adminresister" element={<Adminresister />} />
          <Route path="/Adminlogin" element={<Adminlogin />} />
          <Route path="/Admingmail" element={<Admingmail />} />
          <Route path="/Adminpassword" element={<Adminpassword />} />
          <Route path="/Admindelete" element={<Admindelete />} />
          <Route path="/Customerresister" element={<Customerresister />} />
          <Route path="/Customerlogin" element={<Customerlogin />} />
          <Route path="/Customergmail" element={<Customergmail />} />
          <Route path="/Customerpassword" element={<Customerpassword />} />
          <Route path="/Productpage" element={<Productpage />} />
        </Routes>
      </div>
    </Router>
  );
}
